    left:0px;
    top:0px;
    right:0px;
    background: linear-gradient(to left bottom, #5a1466  49%, #f8f8f8 50%);
    
    `;
  return (
    <>
        <Skew></Skew>
        <Skew></Skew>
    </>
  )
}

